Let me think through this step by step...

We need a model that predicts the utility of accepting an offer for a responder.  Previous models focused on fairness as a ratio of percentage split to relative contribution.  However, this might overlook the absolute magnitude of the offer and the potential influence of the total earnings.  Responders might be more sensitive to offers appearing grossly unfair given the total amount earned, rather than simply comparing ratios.  The pre-task token collection might also influence their perception of fairness; someone who contributed significantly might expect a larger share.

Let's consider a model that incorporates:

1. **Self-interest:** The absolute monetary value of the offer (`split_self`).
2. **Fairness:**  The perceived fairness of the offer, considered as the difference between the responder's percentage share and an expectation based on their relative contribution. This will account for variations in total earnings.  We will model this as the difference between the received percentage and what is expected based on the relative contributions: (`splitperc_self` - `expected_perc`). This difference will be weighted based on relative contribution.
3. **Contribution Effect:**  The weight given to the fairness term will depend on the relative contribution of the responder.  The larger the contribution, the more sensitive they might be to unfair offers, and thus the larger the weight placed on fairness.

This will be captured by a model with two learnable parameters: one representing the weight of self-interest and the other representing the sensitivity to fairness (modified by relative contribution).


<MODEL>
U_accept = self_interest_weight * split_self + fairness_sensitivity * (splitperc_self - (token_self / (token_self + token_opp)) * 100) * (token_self / (token_self + token_opp))
</MODEL>

<VARIABLES>
