A utility model for responder acceptance decisions that combines self-interest (monetary gain) with a fairness term.  The fairness term is the difference between the received percentage and the expected percentage based on relative contribution, scaled by the relative contribution itself. Two learnable parameters represent the weight of self-interest and the sensitivity to fairness.
</SUMMARY>

